import React from 'react';
import { Link } from 'react-router-dom';

const Navigation: React.FC = () => {
  return (
    <nav style={{ padding: '1rem', borderBottom: '1px solid #ddd' }}>
      <Link to="/" style={{ marginRight: 12 }}>Home</Link>
      <Link to="/register" style={{ marginRight: 12 }}>Register</Link>
      <Link to="/players" style={{ marginRight: 12 }}>Players</Link>
      <Link to="/fixtures" style={{ marginRight: 12 }}>Fixtures</Link>
      <Link to="/schedule" style={{ marginRight: 12 }}>Schedule</Link>
      <Link to="/live" style={{ marginRight: 12 }}>Live Score</Link>
      <Link to="/results" style={{ marginRight: 12 }}>Results</Link>
    </nav>
  );
};

export default Navigation;
